import React from "react";

import "./Header.css";

import SearchIcon from "@mui/icons-material/Search";
import VideoCallIcon from "@mui/icons-material/VideoCall";
import AppsIcon from "@mui/icons-material/Apps";
import NotificationsIcon from "@mui/icons-material/Notifications";
import Avatar from "@mui/material/Avatar";

function Header() {
  return (
    <div className="header">
      <div className="header-left">
        <img src="https://cdn-icons-png.flaticon.com/512/708/708746.png" alt="" />
        <ul className="nav-btns">
          <li className="nav-btn">Home</li>
          <li className="nav-btn">Learn</li>
          <li className="nav-btn">Schedule</li>
          <li>Choreographers</li>
        </ul>
      </div>
      <div className="header-right">
        <VideoCallIcon className="header-icon" />
        <AppsIcon className="header-icon" />
        <NotificationsIcon className="header-icon" />
        <Avatar
          alt="Account"
          src="https://i.pinimg.com/736x/17/4d/35/174d35610b40f7f35df93dd406a56d19.jpg"
        />
      </div>
    </div>
  );
}

export default Header;
